import React from 'react'
import styled from 'styled-components';

const ReviewCardWrap = styled.div`
    border: 1px solid gray;
    width: 45%;
    padding: 20px;
    border-radius: 3px;
    box-sizing: border-box;

    & > div + div {
        margin-top: 15px;
    }
`

function ReviewCard() {
    return (
        <ReviewCardWrap>
            <div style={{ fontSize: '2rem' }}>제목</div>
            <div>나의 별점</div>
            <div>후기 내용 ...</div>
            <button>더보기</button>
        </ReviewCardWrap>
    )
}

export default ReviewCard
